-- Volcando estructura para procedimiento bosquede_sistemas.sp_gideal
DELIMITER //
CREATE PROCEDURE `sp_gideal`(
	IN `año` INT,
	IN `proyecto` VARCHAR(50)

)
BEGIN
select vrenta.clave_proyecto,vrenta.concepto,vrenta.superficie,vrenta.nombre,vrenta.razon,
ifnull(anterior.totalanterior,0) as totalanterior,ifnull(ene.totalene,0) as totalene,
ifnull(feb.totalfeb,0) as totalfeb,ifnull(mar.totalmar,0) as totalmar,ifnull(abr.totalabr,0) as totalabr,
ifnull(may.totalmay,0) as totalmay,ifnull(jun.totaljun,0) as totaljun,ifnull(jul.totaljul,0) as totaljul,
ifnull(ago.totalago,0) as totalago,ifnull(sep.totalsep,0) as totalsep,ifnull(octu.totaloctu,0) as totaloctu,
ifnull(nov.totalnov,0) as totalnov,ifnull(dic.totaldic,0) as totaldic,ifnull(anu.totalanu,0) totalanu,ifnull(pos.totalpos,0) as totalpos
from 
vrenta
left join
(select clave_proyecto,folio_renta,sum(renta) as totalanterior from cuentarenta where year(fecha)<(año)
group by clave_proyecto,folio_renta) as anterior 
on vrenta.clave_proyecto=anterior.clave_proyecto and vrenta.folio_renta=anterior.folio_renta
left join
(select clave_proyecto,folio_renta,sum(renta) as totalene from cuentarenta where year(fecha)=año and month(fecha)=1
group by clave_proyecto,folio_renta) as ene
on vrenta.clave_proyecto=ene.clave_proyecto and vrenta.folio_renta=ene.folio_renta
left join
(select clave_proyecto,folio_renta,sum(renta) as totalfeb from cuentarenta where year(fecha)=año and month(fecha)=2
group by clave_proyecto,folio_renta) as feb
on vrenta.clave_proyecto=feb.clave_proyecto and vrenta.folio_renta=feb.folio_renta
left join
(select clave_proyecto,folio_renta,sum(renta) as totalmar from cuentarenta where year(fecha)=año and month(fecha)=3
group by clave_proyecto,folio_renta) as mar
on vrenta.clave_proyecto=mar.clave_proyecto and vrenta.folio_renta=mar.folio_renta
left join
(select clave_proyecto,folio_renta,sum(renta) as totalabr from cuentarenta where year(fecha)=año and month(fecha)=4
group by clave_proyecto,folio_renta) as abr
on vrenta.clave_proyecto=abr.clave_proyecto and vrenta.folio_renta=abr.folio_renta
left join
(select clave_proyecto,folio_renta,sum(renta) as totalmay from cuentarenta where year(fecha)=año and month(fecha)=5
group by clave_proyecto,folio_renta) as may
on vrenta.clave_proyecto=may.clave_proyecto and vrenta.folio_renta=may.folio_renta
left join
(select clave_proyecto,folio_renta,sum(renta) as totaljun from cuentarenta where year(fecha)=año and month(fecha)=6
group by clave_proyecto,folio_renta) as jun
on vrenta.clave_proyecto=jun.clave_proyecto and vrenta.folio_renta=jun.folio_renta
left join
(select clave_proyecto,folio_renta,sum(renta) as totaljul from cuentarenta where year(fecha)=año and month(fecha)=7
group by clave_proyecto,folio_renta) as jul
on vrenta.clave_proyecto=jul.clave_proyecto and vrenta.folio_renta=jul.folio_renta
left join
(select clave_proyecto,folio_renta,sum(renta) as totalago from cuentarenta where year(fecha)=año and month(fecha)=8
group by clave_proyecto,folio_renta) as ago
on vrenta.clave_proyecto=ago.clave_proyecto and vrenta.folio_renta=ago.folio_renta
left join
(select clave_proyecto,folio_renta,sum(renta) as totalsep from cuentarenta where year(fecha)=año and month(fecha)=9
group by clave_proyecto,folio_renta) as sep
on vrenta.clave_proyecto=sep.clave_proyecto and vrenta.folio_renta=sep.folio_renta
left join
(select clave_proyecto,folio_renta,sum(renta) as totaloctu from cuentarenta where year(fecha)=año and month(fecha)=10
group by clave_proyecto,folio_renta) as octu
on vrenta.clave_proyecto=octu.clave_proyecto and vrenta.folio_renta=octu.folio_renta
left join
(select clave_proyecto,folio_renta,sum(renta) as totalnov from cuentarenta where year(fecha)=año and month(fecha)=11
group by clave_proyecto,folio_renta) as nov
on vrenta.clave_proyecto=nov.clave_proyecto and vrenta.folio_renta=nov.folio_renta
left join
(select clave_proyecto,folio_renta,sum(renta) as totaldic from cuentarenta where year(fecha)=año and month(fecha)=12
group by clave_proyecto,folio_renta) as dic
on vrenta.clave_proyecto=dic.clave_proyecto and vrenta.folio_renta=dic.folio_renta
left join
(select clave_proyecto,folio_renta,sum(renta) as totalanu from cuentarenta where year(fecha)=año
group by clave_proyecto,folio_renta) as anu
on vrenta.clave_proyecto=anu.clave_proyecto and vrenta.folio_renta=anu.folio_renta
left join
(select clave_proyecto,folio_renta,sum(renta) as totalpos from cuentarenta where year(fecha)>año
group by clave_proyecto,folio_renta) as pos
on vrenta.clave_proyecto=pos.clave_proyecto and vrenta.folio_renta=pos.folio_renta
where vrenta.clave_proyecto=proyecto;
END//
