from vpagosglobal left join 
(select clave_proyecto,folio_renta,sum(subtotal) as anteriortotal,aplicacion from vpagosglobal where ejercicio=(año-1) group by clave_proyecto,folio_renta,aplicacion) as anterior on vpagosglobal.clave_proyecto=anterior.clave_proyecto
