left join 
(select clave_proyecto,folio_renta,sum(subtotal) as martotal,aplicacion from vpagosglobal where ejercicio=año and mes=3 group by clave_proyecto,folio_renta,aplicacion) as marzo on vpagosglobal.clave_proyecto=marzo.clave_proyecto
and vpagosglobal.folio_renta=marzo.folio_renta and vpagosglobal.aplicacion=marzo.aplicacion
left join 
(select clave_proyecto,folio_renta,sum(subtotal) as abrtotal,aplicacion from vpagosglobal where ejercicio=año and mes=4 group by clave_proyecto,folio_renta,aplicacion) as abril on vpagosglobal.clave_proyecto=abril.clave_proyecto
and vpagosglobal.folio_renta=abril.folio_renta and vpagosglobal.aplicacion=abril.aplicacion
left join 
(select clave_proyecto,folio_renta,sum(subtotal) as maytotal,aplicacion from vpagosglobal where ejercicio=año and mes=5 group by clave_proyecto,folio_renta,aplicacion) as mayo on vpagosglobal.clave_proyecto=mayo.clave_proyecto
and vpagosglobal.folio_renta=mayo.folio_renta and vpagosglobal.aplicacion=mayo.aplicacion
left join 
(select clave_proyecto,folio_renta,sum(subtotal) as juntotal,aplicacion from vpagosglobal where ejercicio=año and mes=6 group by clave_proyecto,folio_renta,aplicacion) as junio on vpagosglobal.clave_proyecto=junio.clave_proyecto
and vpagosglobal.folio_renta=junio.folio_renta and vpagosglobal.aplicacion=junio.aplicacion
left join 
(select clave_proyecto,folio_renta,sum(subtotal) as jultotal,aplicacion from vpagosglobal where ejercicio=año and mes=7 group by clave_proyecto,folio_renta,aplicacion) as julio on vpagosglobal.clave_proyecto=julio.clave_proyecto
and vpagosglobal.folio_renta=julio.folio_renta and vpagosglobal.aplicacion=julio.aplicacion
left join 
(select clave_proyecto,folio_renta,sum(subtotal) as agototal,aplicacion from vpagosglobal where ejercicio=año and mes=8 group by clave_proyecto,folio_renta,aplicacion) as agosto on vpagosglobal.clave_proyecto=agosto.clave_proyecto
and vpagosglobal.folio_renta=agosto.folio_renta and vpagosglobal.aplicacion=agosto.aplicacion
left join 
(select clave_proyecto,folio_renta,sum(subtotal) as septotal,aplicacion from vpagosglobal where ejercicio=año and mes=9 group by clave_proyecto,folio_renta,aplicacion) as septiembre on vpagosglobal.clave_proyecto=septiembre.clave_proyecto
and vpagosglobal.folio_renta=septiembre.folio_renta and vpagosglobal.aplicacion=septiembre.aplicacion
left join 
(select clave_proyecto,folio_renta,sum(subtotal) as octtotal,aplicacion from vpagosglobal where ejercicio=año and mes=10 group by clave_proyecto,folio_renta,aplicacion) as octubre on vpagosglobal.clave_proyecto=octubre.clave_proyecto
and vpagosglobal.folio_renta=octubre.folio_renta and vpagosglobal.aplicacion=octubre.aplicacion
left join 
(select clave_proyecto,folio_renta,sum(subtotal) as novtotal,aplicacion from vpagosglobal where ejercicio=año and mes=11 group by clave_proyecto,folio_renta,aplicacion) as noviembre on vpagosglobal.clave_proyecto=noviembre.clave_proyecto
and vpagosglobal.folio_renta=noviembre.folio_renta and vpagosglobal.aplicacion=noviembre.aplicacion
left join 
(select clave_proyecto,folio_renta,sum(subtotal) as dictotal,aplicacion from vpagosglobal where ejercicio=año and mes=12 group by clave_proyecto,folio_renta,aplicacion) as diciembre on vpagosglobal.clave_proyecto=diciembre.clave_proyecto
and vpagosglobal.folio_renta=diciembre.folio_renta and vpagosglobal.aplicacion=diciembre.aplicacion
left join 
(select clave_proyecto,folio_renta,sum(subtotal) as anutotal,aplicacion from vpagosglobal where ejercicio=año group by clave_proyecto,folio_renta,aplicacion) as anual on vpagosglobal.clave_proyecto=anual.clave_proyecto
and vpagosglobal.folio_renta=anual.folio_renta and vpagosglobal.aplicacion=anual.aplicacion where vpagosglobal.clave_proyecto=proyecto
and case selector when "RENTA" then vpagosglobal.aplicacion="RENTA" when "CUOTA" then vpagosglobal.aplicacion ="CUOTA DE MANTENIMIENTO" WHEN "DEPOSITO" THEN vpagosglobal.aplicacion="DEPOSITO" ELSE TRUE END
group by vpagosglobal.clave_proyecto,vpagosglobal.folio_renta,vpagosglobal.aplicacion;
end//
DELIMITER ;

-- Volcando estructura para procedimiento bosquede_sistemas.sp_mensual
DELIMITER //
CREATE PROCEDURE `sp_mensual`(
	IN `fechasp` DATE,
	IN `proyecto` varchar(50)


)
begin
declare mes int default month(fechasp);
declare año int default year(fechasp);
  select vrenta.clave_proyecto,vrenta.folio_renta,vrenta.concepto,vrenta.superficie,vrenta.nombre,vrenta.razon,
ifnull(vallpagosrenta.deposito,0) as deposito,vallpagosrenta.pago,vallpagosrenta.fechapago,
ifnull(acumulado.pagoacum,0) as pagoacum,ifnull(cuentaact.cuentaact,0) as rentaactual,ifnull(actual.pagoactual,0)as pagoactual,
ifnull(pagospost.pagopos,0)as pagosposteriores,ifnull(round(flujo.flujopos/1.16,2),0)as flujoposterior

from vrenta 
left join 
vallpagosrenta 
on vrenta.clave_proyecto=vallpagosrenta.clave_proyecto and vrenta.folio_renta=vallpagosrenta.folio_renta and vallpagosrenta.numero=0

left join 
(select clave_proyecto,folio_renta,sum(subtotal) as pagoactual from pagorenta 
where year(fecha)=año and month(fecha)=mes and referencia<>0 and tipo="RENTA"
group by clave_proyecto,folio_renta,year(fecha),month(fecha)) as actual
on vrenta.clave_proyecto=actual.clave_proyecto and vrenta.folio_renta=actual.folio_renta

left join 
(select clave_proyecto,folio_renta,sum(subtotal) as pagoacum from pagorenta 
where fecha<fechasp and referencia<>0 and tipo="RENTA"
group by clave_proyecto,folio_renta) as acumulado
on vrenta.clave_proyecto=acumulado.clave_proyecto and vrenta.folio_renta=acumulado.folio_renta

left join
(select clave_proyecto,folio_renta,sum(subtotal) as pagopos from pagorenta 
where fecha>LAST_DAY(fechasp) and referencia<>0 and tipo="RENTA"
group by clave_proyecto,folio_renta) as pagospost
on vrenta.clave_proyecto=pagospost.clave_proyecto and vrenta.folio_renta=pagospost.folio_renta

left join
(select clave_proyecto,folio_renta,sum(saldorenta) as flujopos from cuentarenta 
where fecha>LAST_DAY(fechasp)  
group by clave_proyecto,folio_renta) as flujo
on vrenta.clave_proyecto=flujo.clave_proyecto and vrenta.folio_renta=flujo.folio_renta

left join
(select clave_proyecto,folio_renta,sum(renta) as cuentaact from cuentarenta 
where year(fecha)=año and month(fecha)=mes  
group by clave_proyecto,folio_renta) as cuentaact
on vrenta.clave_proyecto=cuentaact.clave_proyecto and vrenta.folio_renta=cuentaact.folio_renta
where vrenta.clave_proyecto=proyecto
order by vrenta.clave_proyecto,vrenta.concepto;

end//
DELIMITER ;

